export const getSudokuBoard = () => {
  return (dispact) => {
    fetch('https://sugoku.herokuapp.com/board', {
      method: 'GET',
      headers: {
      'Content-Type': 'application/json'
      },
    })
      .then( resp => resp.json())
      .then( data => 
        dispact({
          type: 'SET_SUDOKU_BOARD',
          payload: {
            sudokuBoard: data
          }
        }))
  }
}
